al whiteboard.</span></li><li><span style=\\\"font-size:1.25em;color:#000000\\\"><strong>Emoji stamps</strong> - show how you feel or vote on ideas.</span></li><li><span style=\\\"font-size:1.25em;color:#000000\\\"><strong>Share button</strong> -  Invite teammates to collaborate in real time.</span></li></ul>\"},\"subContentId\":\"2b06ebd2-f35c-4c10-ae00-561b96fbceec\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\"}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":58.21917808219178,\"y\":24.805054819171147,\"width\":36.529680365296805,\"height\":51.86037911143784,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\",\"alt\":\"Miro board sample, showing its core features\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4AAQSkZJRgABAQAAAQABAAD/2wBDAAMCAgICAgMCAgIDAwMDBAYEBAQEBAgGBgUGCQgKCgkICQkKDA8MCgsOCwkJDRENDg8QEBEQCgwSExIQEw8QEBD/2wBDAQMDAwQDBAgEBAgQCwkLEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBD/wAARCASwBkADAREAAhEBAxEB/8QAHgABAAAHAQEBAAAAAAAAAAAAAAECBAUGBwgDCQr/xAB3EAABAwMCAgMIBw8NCgwDAREBAAIDBAURBgcSIQgTMRQVIkFRVGHRFjI1cZGjsgkXIzZCUlNzgYKSk6GxwRgkMzRDVWJydJWz0vAlRFd2g5SitNPhGSY3OFZYY2R1lsLURYS1KDlGZaTxJ4WXw+JId6bjZoal/8QAHAEBAAEFAQEAAAAAAAAAAAAAAAECAwQFBgcI/8QATBEBAAEDAQUDCAgEBQIFBAAHAAECAxEEBRITITEGQVEUFRYiMlJxgQcjMzRCYZGhJDVTsRclQ8HwY9E2YpLh8QgmcqKCskRURVVz/9oADAMBAAIRAxEAPwD6b36/TUUzLZbImy1ko4iXe0hZ9cfT5B/YhYpbaKz6JdaqaskJz4TyGtP8EDAAQeQs9oH96f6bvWgd57R5p/pn1oJu81o8VMPxjvWgd5bR4qYfjHetA7zWjzYfjXetA7zWjzYfjXetBDvNZ/Nh+Nd60DvNZ/Nh+Nd60Ee81o82H413rQO81o82H413rQO81o81H413rQO8to81+Nd60EO81n82H413rQR7zWjzYfjXetAFmtB7KUfjXetA7zWjzYfjXetA7zWjzYfjXetA7zWjzYfjXetB595rR5oPxrvWgd5rR5p8a71oHea0eaD8a71oHea0eaD8a71oHea0eaD8a71oHea0eaD8a71oHea0eaD8a71oHea0eaD8a71oI
